      SUBROUTINE PDERG(K,M,NN,H,F,DKF,NV,IX,NMX,IW,ICON)
      IMPLICIT REAL*8(A-H,O-Z)
      LOGICAL COND
      COMMON/SDERA/ A(25792)
      DIMENSION F(*),DKF(*),NN(*),NMX(*),IW(*)
C
C       K:  Ordre de la derivada
C       M:  Numero de punts farem servir per trovar la derivada
C      NN:  Vector on posarem las dimensions reals de les variables
C           1 fins a NV. Diemensio >= NV
C       H:  Pas per la variables IX
C       F:  Matriu de la funcio multivariable
C     DKF:  Matriu de la deivada parcial de F respecte la variable IX
C      NV:  Numero de variables de la funcio
C      IX:  Index corresponent a la variable de la que volem calcular
C           la derivada parcial
C     NMX:  Vector on posarem les dimensions maximas dels NV-1 primers
C           index, dimensio >= 2*NV-2:
C                 1  fins a   NV-1 per la matriu F
C                 NV fins a 2*NV-2 per la matriu DKF
C      IW:  Vector auxiliar de dimensio >=4*NV-1
C
C     Funciones especiales:
C      ICON:
C         0 Calcula la derivada deseada
C
C         2 Es com si afagisim un punt mes de la funcio a la
C           dreta del ultim punt del grid, amb valor 0.
C
C         3 El mateix que per ICON=2 i a fa la mateixa hipotesi
C           a l'esquerra del primer punt del grid.
C
C         4 Fa una reflexio parell de la funcio per els primers
C           punts, per tal de tenir els punts de la derivada
C           centrats, per aquests primers punts
C
C         5 El mateix que per ICON=4 pero amb reflexio sanar
C
C         6 El mateix que ICON=4 i ICON=2
C
C         7 El mateix que ICON=5 i ICON=2
C
C         8 Condicions periodicas: ( I<1 <--> I+N, I>N <--> I-N )
C
C        12 Soposem la funcio nulla a la dreta del ultim punt
C           del grid per tal que sempre fem servir els coeficients
C           centrats
C
C        13 El mateix que per ICON=12 i fa la mateixa hipotesi
C           a l'esquerra del primer punt del grid.
C
C        16 El mateix que ICON=4 i ICON=12
C
C        17 El mateix que ICON=5 i ICON=12
C
C        20 Condicions periodiques de Wigner_Seitz ( N+i <--> N-i )
C
C        24 El mateix que ICON= 4 i ICON=20
C
C        25 El mateix que ICON= 5 i ICON=20
C
C
C     Restriccions:
C       M:  Te que esser sanas, mes gran o igual a 3 
C           y mes petit o igual que 25
C       K:  Pot valdre desde 1 fins M-1
C  NN(IX):  Te que esser mes gran o igual que M
C
C
      N=NN(IX)
      IF(M.LT.3.OR.M.GT.25.OR.M.GT.N.OR.MOD(M,2).EQ.0
     &  .OR.K.LT.0.OR.K.GT.M-1)THEN
        WRITE(*,1100)N,M,K
        RETURN
      ENDIF
      SIG=1.0D0-2.0D0*MOD(K,2)
      MM1=M-1
      COND=K.LT.MM1
      HK=H**K
      JI=1
      M2=M*M
      MM1O2=MM1/2
      M21O2=(M2+1)/2
      FACT=1.0D0/HK
      DO I=3,M-2,2
        JI=JI+(I*I+1)*(I-2)/2+I
      ENDDO
      JI=JI+M21O2*(K-1)
      IF(COND)THEN
        JF=JI+M21O2-1
      ELSE
        JF=JI+MM1
      ENDIF
      N0=MM1O2+1
      NF=N-MM1O2
      NRV=1
      NVM1=NV-1
      NVM2=NV-2
      I0=0
      IND0=NV-1
      IPF0=2*NV-1
      IPD0=3*NV-1
      IPF1=1+IPF0
      IPD1=1+IPD0
      IW(IPF1)=1
      IW(IPD1)=1
      DO IV=1,NVM1
        IF(IV.EQ.IX)I0=1
        I1=IV+I0
        IV1=IV+1
        NRV=NRV*NN(I1)
        IW(IV)=I1
        IND1=IND0+I1
        IW(IND1)=1
        IPFV=IV+IPF0
        IPDV=IV+IPD0
        IPFV1=IV1+IPF0
        IPDV1=IV1+IPD0
        IW(IPFV1)=IW(IPFV)*NMX(IV)
        IW(IPDV1)=IW(IPDV)*NMX(IV+NVM1)
      ENDDO
      IOV=IW(1)
      INDV=IOV+IND0
      IW(INDV)=0
      DO IT=1,NRV
        IJKF0=1
        IJKD0=1
        IOV=IW(1)
        INDV=IOV+IND0
        IW(INDV)=IW(INDV)+1
        DO IV=1,NVM2
          IOV=IW(IV)
          II=NN(IOV)
          INDV=IOV+IND0
          JJ=IW(INDV)
          IF(JJ.GT.II)THEN
            IV1=IV+1
            IW(INDV)=1
            IOV1=IW(IV1)
            INDV1=IOV1+IND0
            IW(INDV1)=IW(INDV1)+1
          ENDIF
          INDV=IOV+IND0
          IPFV=IOV+IPF0
          IPDV=IOV+IPD0
          IJKF0=IJKF0+(IW(INDV)-1)*IW(IPFV)
          IJKD0=IJKD0+(IW(INDV)-1)*IW(IPDV)
        ENDDO
        INDV=IW(NVM1)+IND0
        IPFV=IW(NVM1)+IPF0
        IPDV=IW(NVM1)+IPD0
        IJKF0=IJKF0+(IW(INDV)-1)*IW(IPFV)
